    false,nt"url": null,nt"notes": "This narrative report for Medicine Lake
    NWR outlines Refuge accomplishments from September through December of 1942. The
    report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and collections
    and receipts. Resource management is outlined; topics include grazing, haying, and
    fur harvesting. The public relations section of the report describes recreational
    uses, Refuge visitors, hunting, and violations. N-R forms and photographs are attached.",nt"owner_org":
